import React from 'react'

const Quiz = () => {

  var paper = [
    { id: 1, question: 'Are you?', answer: ['male', 'female'], Rating: [20, 10, 10] },

    {
      id: 2, question: 'What type of home do you live', answer: ['Mansion (more than 6 bedrooms)', 'Detached', 'Cottage', 'Terrace ( 3 floors)', 'Terrace ( 2 floors)', 'Bungalow', 'Flat (Purpose build)', 'Flat (Conversion)', 'Town House', 'Do you own more that 1 home?'], Rating: [10, 9, 8.7,7,6,5,4,6,]
    },

    { id: 3, question: 'How well is your home insulated', answer: ['Very well', `It's OK`, 'Drafts everywhere', `Don't know`] },

    { id: 4, question: 'How many adults (16+) live in your home', answer: [1, 2, 3, 4, 5, '6+'] }

  ];

  console.log(paper);

  return (
    <>
      {paper.map((question) => {
        console.log('question', question);
      })}


    </>
  )
}
export default Quiz;
